import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
    colorButton: {
        color: "white",
        height: "2em",

        border: "solid 3px #f95a00",
        borderRadius: "15px",
        padding: "1em 3em",
    },
    downArrow: {
        textAlign: "center",
        color: "#f95a00",
        fontSize: "2em",
        margin: "0",
    },
    alt: {},
});

export default useStyles;
